import React, { createContext, useState, useEffect } from 'react';

import useAuth from './hooks/useAuth';

const Context = createContext();

function AuthProvider({ children }) {
  return (
    <Context.Provider value={{}}>
      {children}
    </Context.Provider>
  );
}

export { Context, AuthProvider };
